import React from "react";
import { NewDestinationForm } from './NewDestinationForm';


export const Bucket = (props) => {

    const { bucket, updateBucket} = props;

    // console.log(bucket);
    // console.log(bucket.destinations);

    const deleteBucket = () => {
        props.deleteBucket(bucket);
    }

    const deleteDestination = (destination) => {
        console.log('inside deleteDestination function in Bucket');
        const updatedBucket = {
            ...bucket,
            destinations: bucket.destinations.filter((x) => x !== destination) //removed id
        };
        console.log(destination, 'was deleted');
        updateBucket(updatedBucket);
    }

    const addNewDestination = (destination) => {
        console.log('inside addNewDestination in Bucket.js');
		console.log('destination.name is: ' + destination.name);
		console.log('destination.seat is ' + destination.seat);
        return updateBucket({...bucket, destinations: [...bucket.destinations, destination]})
    };

    const destinations = () => (  //creating destinations
        <ul>
            {bucket.destinations.map((destination, index) => (
                <ul className="d-inline p-2" key={index}>
                    <h5>{`name: ${destination.name}, seat: ${destination.seat}, date: ${destination.date}`}</h5>
                    <button className="btn btn-danger btn-sm" onClick={(e) => deleteDestination(destination)}>delete</button> 
                    {/* removed id from destination*/}
                </ul>
            ))}

        </ul>
    );


    return (
        <div>

        <div className="">

            <div className="card-header text-center mt-3">
                <h1>{bucket.location}</h1><NewDestinationForm addNewDestination={addNewDestination} /><button className="btn btn-danger" onClick={deleteBucket}>delete bucket</button>
            </div>

            <div className="card-body">
            {
                destinations({ destinations, bucketId: bucket.id, deleteDestination })
            }
            </div>

            <div class="card mb-3">
  <h3 class="card-header">Card header</h3>
  <div class="card-body">
    <h5 class="card-title">Special title treatment</h5>
    <h6 class="card-subtitle text-muted">Support card subtitle</h6>
  </div>
  <svg xmlns="http://www.w3.org/2000/svg" class="d-block user-select-none" width="100%" height="200" aria-label="Placeholder: Image cap" focusable="false" role="img" preserveAspectRatio="xMidYMid slice" viewBox="0 0 318 180" style="font-size:1.125rem;text-anchor:middle">
    <rect width="100%" height="100%" fill="#868e96"></rect>
    <text x="50%" y="50%" fill="#dee2e6" dy=".3em">Image cap</text>
  </svg>
  <div class="card-body">
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
  </div>
  <ul class="list-group list-group-flush">
    <li class="list-group-item">Cras justo odio</li>
    <li class="list-group-item">Dapibus ac facilisis in</li>
    <li class="list-group-item">Vestibulum at eros</li>
  </ul>
  <div class="card-body">
    <a href="#" class="card-link">Card link</a>
    <a href="#" class="card-link">Another link</a>
  </div>
  <div class="card-footer text-muted">
    2 days ago
  </div>
</div>
<div class="card">
  <div class="card-body">
    <h4 class="card-title">Card title</h4>
    <h6 class="card-subtitle mb-2 text-muted">Card subtitle</h6>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="card-link">Card link</a>
    <a href="#" class="card-link">Another link</a>
  </div>
</div>


        </div>
        <br></br>
        </div>

    );
};
